        public class BitFontCharacter
        {
            public byte[] Data;
            public int Height;
            public int Width;
            public char Character;

            public BitFontCharacter(char aCharacter, int aWidth, int aHeight, byte[] aData)
            {
                Character = aCharacter;
                Width = aWidth;
                Height = aHeight;
                Data = aData;
            }
        }


        public BitFontCharacter getBitFontCharacter(String aCharacter, Font aFont)
        {
            int maxCharSize = 512;
            BitFontCharacter result = null; 

            Bitmap tempBitmap = new Bitmap(maxCharSize, maxCharSize);
            Graphics g = Graphics.FromImage(tempBitmap);
            g.PageUnit = GraphicsUnit.Pixel;

            StringFormat format = StringFormat.GenericTypographic;
            format.FormatFlags |= StringFormatFlags.MeasureTrailingSpaces;

            SizeF fontSize = g.MeasureString(aCharacter, aFont, new PointF(0, 0), format);

            float fontBitmapHeight = -1f;
            float fontBitmapWidth = -1f;

            if (useFixedWidth.Checked)
            { 
                fontBitmapWidth = (float)fixedWidth.Value;
            }
            else 
            {
                fontBitmapWidth = fontSize.Width;
            }


            if (useFixedHeight.Checked)
            {
                fontBitmapHeight = (float)fixedHeight.Value;
            }
            else
            {
                fontBitmapHeight = fontSize.Height;
            }

            Bitmap b = new Bitmap((int)fontBitmapWidth, (int)fontBitmapHeight);  

            System.Drawing.StringFormat f = new System.Drawing.StringFormat();
            //http://www.codeproject.com/Articles/2118/Bypass-Graphics-MeasureString-limitations
            //System.Drawing.Region[] r = g.MeasureCharacterRanges(aCharacter, aFont, new RectangleF(0, 0, fontSize.Width, fontSize.Height), f);
            


            Graphics drawingGraphics = Graphics.FromImage(b); 
            drawingGraphics.TextRenderingHint = TextRenderingHint.SingleBitPerPixelGridFit;
            drawingGraphics.SmoothingMode = System.Drawing.Drawing2D.SmoothingMode.None;
            drawingGraphics.CompositingQuality = System.Drawing.Drawing2D.CompositingQuality.AssumeLinear;
            drawingGraphics.InterpolationMode = System.Drawing.Drawing2D.InterpolationMode.NearestNeighbor;
            drawingGraphics.Clear(Color.White);

            float offsetX = 0;
            float offsetY = 0;

            if (useFixedWidth.Checked)
            {
                offsetX = (fontBitmapWidth - (int)fontSize.Width) / 2;
            }

            if (useFixedHeight.Checked)
            {
                offsetY = (fontBitmapHeight - (int)fontSize.Height) / 2;
            }
            else
            {
                offsetY = -1f;
            }


            if (chkFixedOffsetX.Checked)
            {
                offsetX = (int)fixedOffsetX.Value;
            }

            if (chkFixedOffsetY.Checked)
            {
                offsetY = (int)fixedOffsetY.Value;
            }

            drawingGraphics.DrawString(aCharacter, aFont, new SolidBrush(Color.Black), offsetX, offsetY, format);  
            drawingGraphics.Flush();

            List<bool> bools = new List<bool>();


            for (int y = 0; y < b.Height; y += 1)
            {
                for (int x = 0; x < b.Width; x += 1)
                {
                    if (b.GetPixel(x, y).B == 255)
                    {
                        //System.Console.Write("X");
                        bools.Add(false);
                    }
                    else
                    {
                        //System.Console.Write("I");
                        bools.Add(true);
                    }
                }
            }
             
            int totalBytes = (bools.Count / 8) + ((bools.Count % 8) > 0 ? 1 : 0);

            byte[] bytes = new byte[totalBytes];
               
            int currentByte = 0;
            for (int i = 0; i < bools.Count; i += 1) 
            {
                currentByte = (i / 8); 
                BitUtils.SetBit(ref bytes[currentByte], (i % 8), bools[i]);
                if (BitUtils.GetBit(bytes[currentByte], (i % 8)) == bools[i])
                {
                    //Console.Write("");
                }

            }

            result = new BitFontCharacter(aCharacter.ToCharArray()[0], (int)fontBitmapWidth, (int)fontBitmapHeight, bytes); /*(int)fontSize.Width hardcoded width*/

            return result;
        }



        public void DrawString(ref byte[] aBytes, String aValue, int aX, int aY, bool aInvert)
        {
            int currentX = 0;
            int currentY = 0;

            int bitsToTrimX = 0;

            foreach (char c in aValue)
            {
                BitFontCharacter font = getBitFontCharacter(c.ToString(), txtCharacterSet.Font);

                int currentFontBit = 0;
                int currentScreenBit = 0;

                //bitsToTrimX = (int)(font.Width * .2f);

                if ((400 - (aX + currentX)) < font.Width) //If there isn't enough room to draw
                {
                    currentY += (int)(font.Height * 1f);
                    currentX = 0;
                }

                for (int y = 0; y < font.Height; y += 1)
                {
                    currentScreenBit = ((y + aY + currentY) * 400) + aX + currentX;

                    for (int x = 0; x < font.Width; x += 1)
                    {
                        //if ((x > bitsToTrimX) && (x < (font.Width - (bitsToTrimX * 2))))
                        //{ 
                        bool fontbit = BitUtils.GetBit(font.Data[currentFontBit / 8], currentFontBit % 8);
                        if (fontbit) //Transparency on white bits
                        {
                            BitUtils.SetBit(ref aBytes[currentScreenBit / 8], 7 - (currentScreenBit % 8), fontbit != aInvert);
                        }
                        currentScreenBit += 1;
                        //}

                        currentFontBit += 1;
                    }
                }

                currentX += (int)(font.Width * 1f);
                // int characterSpacing = (int)((font.Width * .75f) / 3f);

            }
        }

