        private void button1_Click(object sender, EventArgs e)
        { 
            StringBuilder charactersObjectArray = new StringBuilder();

            if (rbLegacy.Checked)
            {
                charactersObjectArray.Append("\\\\Font Name: " + txtName.Text + "\r\n\r\n");
                for (int c = 0; c < txtCharacterSet.Text.Length; c += 1)
                {
                    BitFontCharacter currentChar = getBitFontCharacter(txtCharacterSet.Text.Substring(c, 1), txtCharacterSet.Font);

                    charactersObjectArray.Append("\\\\Char: " + currentChar.Character);
                    charactersObjectArray.Append(" {");
                    for (int i = 0; i < currentChar.Data.Length - 1; i += 2)
                    { 
                        ushort word = (ushort)BitConverter.ToUInt16(currentChar.Data, i);

                        charactersObjectArray.Append("0x" + (word.ToString("X").PadRight(4, '0').Substring(0,4)));
                        if (i != currentChar.Data.Length - 1)
                        {
                            charactersObjectArray.Append(",");
                        }
                    }
                    charactersObjectArray.Append("}\r\n");
                }


            }
            else
            {
                charactersObjectArray.Append("public static class " + txtName.Text + "\r\n");
                charactersObjectArray.Append("{\r\n");
                charactersObjectArray.Append("  private static BitFontCharacter[] characters = new BitFontCharacter[] {\r\n");


                BitFontCharacter firstChar = getBitFontCharacter(txtCharacterSet.Text.Substring(0, 1), txtCharacterSet.Font);

                charactersObjectArray.Append(firstChar.Height);

                for (int c = 0; c < txtCharacterSet.Text.Length; c += 1)
                {
                    BitFontCharacter currentChar = getBitFontCharacter(txtCharacterSet.Text.Substring(c, 1), txtCharacterSet.Font);

                    charactersObjectArray.Append("'" + new String(new char[1] { currentChar.Character }).Replace("\\", "\\\\").Replace("'", "\\'").Replace("\"", "\\\"") + "',");
                }

                for (int c = 0; c < txtCharacterSet.Text.Length; c += 1)
                {
                    BitFontCharacter currentChar = getBitFontCharacter(txtCharacterSet.Text.Substring(c, 1), txtCharacterSet.Font);

                    charactersObjectArray.Append(currentChar.Width + ",");
                }


                for (int c = 0; c < txtCharacterSet.Text.Length; c += 1)
                {
                    BitFontCharacter currentChar = getBitFontCharacter(txtCharacterSet.Text.Substring(c, 1), txtCharacterSet.Font);

                    charactersObjectArray.Append(" new byte[] {");
                    for (int i = 0; i < currentChar.Data.Length; i += 1)
                    {
                        byte currentByte = currentChar.Data[i];
                        charactersObjectArray.Append(currentByte.ToString());
                        if (i != currentChar.Data.Length - 1)
                        {
                            charactersObjectArray.Append(",");
                        }
                    }
                    charactersObjectArray.Append("}");
                }


                for (int c = 0; c < txtCharacterSet.Text.Length; c += 1)
                {
                    BitFontCharacter currentChar = getBitFontCharacter(txtCharacterSet.Text.Substring(c, 1), txtCharacterSet.Font);



                    charactersObjectArray.Append("            new BitFontCharacter ('" + new String(new char[1] { currentChar.Character }).Replace("\\", "\\\\").Replace("'", "\\'").Replace("\"", "\\\"") + "', " + currentChar.Width + ", " + currentChar.Height + ", new byte[] {");
                    for (int i = 0; i < currentChar.Data.Length; i += 1)
                    {
                        byte currentByte = currentChar.Data[i];
                        charactersObjectArray.Append(currentByte.ToString());
                        if (i != currentChar.Data.Length - 1)
                        {
                            charactersObjectArray.Append(",");
                        }
                    }
                    charactersObjectArray.Append("})");

                    if (c != txtCharacterSet.Text.Length - 1)
                    {
                        charactersObjectArray.Append(", \r\n");
                    }
                }
                charactersObjectArray.Append("            \r\n};\r\n\r\n");

                charactersObjectArray.Append("  private static string characterSet = \"" + txtCharacterSet.Text.Replace("\\", "\\\\").Replace("'", "\\'").Replace("\"", "\\\"") + "\";\r\n\r\n");

                charactersObjectArray.Append("  public static BitFontCharacter getFontCharacter(char aChar)\r\n");
                charactersObjectArray.Append("  {\r\n");
                charactersObjectArray.Append("    return characters[characterSet.IndexOf(aChar)];\r\n");
                charactersObjectArray.Append("  }\r\n");
                charactersObjectArray.Append("}\r\n");
                charactersObjectArray.Append("\r\n");
                charactersObjectArray.Append("\r\n");

                if (chkIncludeBitFontCharacterClass.Checked)
                {
                    charactersObjectArray.Append("public class BitFontCharacter\r\n");
                    charactersObjectArray.Append("{\r\n");
                    charactersObjectArray.Append("  public byte[] Data;\r\n");
                    charactersObjectArray.Append("  public int Height;\r\n");
                    charactersObjectArray.Append("  public int Width;\r\n");
                    charactersObjectArray.Append("  public char Character;\r\n");
                    charactersObjectArray.Append("\r\n");
                    charactersObjectArray.Append("  public BitFontCharacter(char aCharacter, int aWidth, int aHeight, byte[] aData)\r\n");
                    charactersObjectArray.Append("  {\r\n");
                    charactersObjectArray.Append("    Character = aCharacter;\r\n");
                    charactersObjectArray.Append("    Width = aWidth;\r\n");
                    charactersObjectArray.Append("    Height = aHeight;\r\n");
                    charactersObjectArray.Append("    Data = aData;\r\n");
                    charactersObjectArray.Append("  }\r\n");
                    charactersObjectArray.Append("}\r\n");
                    charactersObjectArray.Append("\r\n");
                    charactersObjectArray.Append("\r\n");
                }
            }

            txtClass.Text = charactersObjectArray.ToString();
        }

        
        public static byte BitArrayToByteArray(BitArray bits)
        {
            byte[] ret = new byte[Math.Max(bits.Length / 8, 1)];
            bits.CopyTo(ret, 0);
            return ret[0];
        }
         
