        private void useFixedHeight_CheckedChanged(object sender, EventArgs e)
        {
            fixedHeight.Enabled = useFixedHeight.Checked;
        }

        private void chkFixedOffsetX_CheckedChanged(object sender, EventArgs e)
        {
            fixedOffsetX.Enabled = (chkFixedOffsetX.Checked);
            fixedOffsetY.Enabled = (chkFixedOffsetY.Checked);
        }

        private void rbModern_CheckedChanged(object sender, EventArgs e)
        {
            if (rbLegacy.Checked)
            {
                chkIncludeBitFontCharacterClass.Enabled = false;
                lblClass.Text = "C++ Byte Array";
                btnGenerateCode.Text = "Generate Data";
            }
            else
            {
                chkIncludeBitFontCharacterClass.Enabled = true;
                lblClass.Text = "C# Source Code";
                btnGenerateCode.Text = "Generate Code";
            }
        }

